const LOGIN_API_BASE_URL = 'http://localhost:8080/api/v1/login'

class TokenService {
    async getTokens(username, password) {
      try {
        const response = await axios.post(LOGIN_API_BASE_URL, null, {
            params: {
                username: username,
                password: password
            }
        });
